def main():
    MOD = 10 ** 7 + 7
    (n, m) = [int(x) for x in input().split()]
    mat = []
    for row in range(n):
        r = [int(x) for x in input().split()]
        mat.append(r)
    dp = [[0 for j in range(m)] for i in range(n)]
    for j in range(m - 1, -1, -1):
        for i in range(n):
            if j == m - 1:
                dp[i][j] = mat[i][j]
            else:
                tmp = 0
                for k in range(n):
                    tmp += dp[k][j + 1]
                dp[i][j] = mat[i][j] * tmp % MOD
    ans = 0
    for i in range(n):
        ans += dp[i][0]
    ans %= MOD
    print(ans)
main()
